import classes from "./Home.module.css"
function Contact(){
    return (
        <div className={classes.contact}>
            <p className={classes.contactTitle}>CONTACT</p>
            <p className={classes.quote}>𝐰𝐞 𝐛𝐫𝐞𝐰 𝐬𝐩𝐞𝐜𝐢𝐚𝐥𝐭𝐲 𝐜𝐨𝐟𝐟𝐞𝐞 𝐟𝐨𝐫 #𝐨𝐚𝐦𝐞𝐧𝐢𝐟𝐚𝐢𝐧𝐢</p>
        </div>
    )
}

export default Contact;
